import post from './Post.module.css'
import postImg from '../../../../img/postImg.jpg'

const Wall = (props) => {
    return (
    <div>
        <div className={post.item}>
            {props.name}: {props.text}
        </div>
        <div className={post.item}>
            <img src={postImg} alt={"img_post"}/>
            <div><span>Like: {props.likeCount}</span></div>
        </div>
    </div>
    );
}

export default Wall;
